import digital from './images/bg_3.jpg';
import software from './images/bg_3.jpg';
import marketing from './images/bg_3.jpg';


const Sdata = [
    {
        imgsrc: web,
        title: "Web Development",
    },
    {
        imgsrc: app,
        title: "App Development",
    },
    {
        imgsrc: software,
        title: "Software Development",
    },
    {
        imgsrc: digital,
        title: "Digital Marketing",
    },
    {
        imgsrc: android,
        title: "Android Development",
    },
    {
        imgsrc: marketing,
        title: "Social Media Marketing",
    },
]

export default Sdata;
